class BaseTestContractErrors:
    """ContractErrors for the BaseTest contract."""

    WhaleBalanceExceeded: BaseTestWhaleBalanceExceededContractError

    WhaleIsContract: BaseTestWhaleIsContractContractError

    def __init__(
        self,
    ) -> None:
        self.WhaleBalanceExceeded = BaseTestWhaleBalanceExceededContractError()
        self.WhaleIsContract = BaseTestWhaleIsContractContractError()

        self._all = [
            self.WhaleBalanceExceeded,
            self.WhaleIsContract,
        ]

    def decode_custom_error(self, data: str) -> tuple[Any, ...]:
        """Decodes a custom contract error."""
        selector = data[:10]
        for err in self._all:
            if err.selector == selector:
                return err.decode_error_data(HexBytes(data[10:]))

        raise ValueError(
            f"BaseTest does not have a selector matching {selector}"
        )


